        $batchSize = 20;
        $i = 1;
        foreach ($dados as $key => $value):            
            
            $rj = new Rj(); 
            $rj->setId($value[0]);
            $rj->setCidade(utf8_decode($value[1]));
            $rj->setLogradouro(utf8_decode($value[2]));
            $rj->setBairro(utf8_decode($value[3]));
            $rj->setCep($value[4]);
            $rj->setTipoLogradouro(utf8_decode($value[5]));
            
            $manager->persist($rj);
            if (($i % $batchSize) === 0) {
                $size = new Size();
                echo 'Flushing batch...' . "\n";
                echo 'Memory: ' . $size->getReadableSize(memory_get_usage()) . "\n";

                $manager->flush();
                $manager->clear();

                echo 'After batch...' . "\n";
                echo 'Memory: ' . $size->getReadableSize(memory_get_usage()) . "\n";  
                unset($size);
            }            
            $i++;
            unset($rj);
            
        endforeach;        

        $manager->flush(); 
        $manager->clear();   	        
